  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Pea Island NWR
  outlines Refuge accomplishments from May through August of 1951. The report begins
  by summarizing the weather conditions, water conditions, and food and cover during
  this period. Wildlife- including migratory birds and furbearers- is also covered.
  The Refuge development and maintenance section discusses physical developments.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  and violations. N-R forms and photographs are attached.\",\n\t\"license_title\":
